import React from 'react';
import './TreasureNav.css';
import TreasureData from './TreasureData';

function TreasureNav() {
    return(
        <div>
            <div>
            <h1>TREASURES TO EXPLORE</h1>
            <h2>Treasures etc.</h2>
            </div>

            <div>
                <Button>Pilze</Button>
                <Button>Tiere</Button>
                <Button>Bäume</Button>
                <Button>Kräuter</Button>
                <Button>Pflanzen</Button>
            </div>
        </div>
    )
}
